function is_empty(a){for(let b in a)return!1;return!0}function storage_get(a){return browser.storage.local.get(null===a?null:a+"").then(b=>{return null===a?b:b[a]}).catch(b=>{console.error(b)})}function storage_set(a,b){return browser.storage.local.set(null===a?b:{[a]:b}).catch(c=>{console.error(c)})}function insert_chapter(a,b){if(-1===a.indexOf(b))if(0==a.length)a.push(b);else{let c=0,d=a.length,e=!0;for(;c<d&&e;)a[c]<b?e=!1:c++;for(a.splice(c,0,b);a.length>MMD_options.max_save_opened;)a.pop()}}